import React from "react";
import { MDBCol, MDBContainer, MDBRow, MDBFooter } from "mdbreact";

const FooterPage = () => {
  return (
    <MDBFooter color="stylish-color" className="font-small mt-4">

      <div className="footer-copyright text-center py-3">
        <MDBContainer fluid>    
          &copy; {new Date().getFullYear()} Copyright: <a href="https://www.MDBootstrap.com"> Meet2Pop </a>
        </MDBContainer>
      </div>
    </MDBFooter>
  );
}

export default FooterPage;
